import { useState } from "react";

export default function Signup() {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [birthDate, setBirthDate] = useState('');
  const [education, setEducation] = useState('');
  const [contact, setContact] = useState('');
  const [email, setEmail] = useState('');
  const [errorMessage, setErrorMessage] = useState('');
  const [firstNameError, setFirstNameError] = useState('');
  const [lastNameError, setLastNameError] = useState('');
  const [birthDateError, setBirthDateError] = useState('');
  const [educationError, setEducationError] = useState('');
  const [contactError, setContactError] = useState('');
  const [emailError, setEmailError] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();

    // Reset all previous error messages
    setFirstNameError('');
    setLastNameError('');
    setBirthDateError('');
    setEducationError('');
    setContactError('');
    setEmailError('');
    setErrorMessage('');

    // Validation
    let valid = true;

    if (!firstName) {
      setFirstNameError('First name is required.');
      valid = false;
    }

    if (!lastName) {
      setLastNameError('Last name is required.');
      valid = false;
    }

    if (!birthDate) {
      setBirthDateError('Birth date is required.');
      valid = false;
    }

    if (!education) {
      setEducationError('Education is required.');
      valid = false;
    }

    if (!contact) {
      setContactError('Contact is required.');
      valid = false;
    }

    const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
    if (!emailRegex.test(email)) {
      setEmailError('Invalid email address.');
      valid = false;
    }

    if (valid) {
      console.log({
        firstName,
        lastName,
        birthDate,
        education,
        contact,
        email,
      });
    } else {
      setErrorMessage('Please fix the errors in the form.');
    }
  };

  return (
    <div className="signup-container">
      <h2>Student Registration Form</h2>
      <form onSubmit={handleSubmit} className="signup-form">
        {errorMessage && <p className="error-message">{errorMessage}</p>}
        <div className="form-group">
          <label>
            First Name:
            <input
              type="text"
              value={firstName}
              onChange={(e) => setFirstName(e.target.value)}
            />
          </label>
          {firstNameError && <p className="field-error">{firstNameError}</p>}
        </div>
        <div className="form-group">
          <label>
            Last Name:
            <input
              type="text"
              value={lastName}
              onChange={(e) => setLastName(e.target.value)}
            />
          </label>
          {lastNameError && <p className="field-error">{lastNameError}</p>}
        </div>
        <div className="form-group">
          <label>
            Birth Date:
            <input
              type="date"
              value={birthDate}
              onChange={(e) => setBirthDate(e.target.value)}
            />
          </label>
          {birthDateError && <p className="field-error">{birthDateError}</p>}
        </div>
        <div className="form-group">
          <label>
            Education:
            <input
              type="text"
              value={education}
              onChange={(e) => setEducation(e.target.value)}
            />
          </label>
          {educationError && <p className="field-error">{educationError}</p>}
        </div>
        <div className="form-group">
          <label>
            Contact:
            <input
              type="text"
              value={contact}
              onChange={(e) => setContact(e.target.value)}
            />
          </label>
          {contactError && <p className="field-error">{contactError}</p>}
        </div>
        <div className="form-group">
          <label>
            Email:
            <input
              type="email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
            />
          </label>
          {emailError && <p className="field-error">{emailError}</p>}
        </div>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}
